import logo from './logo.svg';
import './App.css';
import {useEffect, useState} from 'react';
function App() {
  const [data, setData] = useState([])
  useEffect(() => {
    fetch('http://localhost:3033/users')
    .then(res => res.json)
    .then(data => setData(data))
    .catch(err => console.log(err))

  },[])
  return (
    <div>
      <table>
      <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Email</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item, index) => (
              <tr key={index}>
                <td>{item.ID}</td>
                <td>{item.Name}</td>
                <td>{item.mail}</td>
              </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
